import { Box } from "@mui/material";
import { Colors } from "../../styles/theme";

export default function DashboardFooter(){
    return(
        <Box sx={{
            background:Colors.dim_grey,
            color:Colors.white,
            fontSize:"14px",
            padding:"10px 0",
            textAlign:"center",
        }}>Allrights reseverd by My Bags.Designed by Kuldeep Chaudhary</Box>
    )
}
